"Atunci când o aplicație este fixată, aceasta poate deschide alte aplicații și pot fi accesate date cu caracter personal. 

Dacă dorești să permiți în siguranță accesul cuiva la dispozitivul tău, folosește un utilizator invitat. 

Pentru a folosi fixarea aplicației: 
{0,number,integer}. activează fixarea aplicației; 
{1,number,integer}. deschide Prezentare generală; 
{2,number,integer}. atinge pictograma aplicației din partea de sus a ecranului, apoi atinge Fixează."
